function HeaderComponent({content}) {
    return (
        <header className="pageHeader container d-flex flex-column justify-content-center">
            {content.map((index) => (
                <h1 key={index} className='me-2 ms-2 ms-lg-0 my-2 my-lg-0 text-dark'>{index.title}</h1>
            ))}
            {content.map((index) => (
                <p key={index} className='me-2 ms-2 ms-lg-0 my-2 my-lg-0 text-dark'>{index.subtitle}</p>
            ))}
            {content.map((index) => (
                <p key={index} className='me-2 ms-2 ms-lg-0 my-2 my-lg-0 text-dark' href={index.href}><span className='me-2'>{index.icon}</span>{index.title}</p>
            ))}
        </header>
    );
}

export default HeaderComponent;
